import React from 'react';
import { NavLink } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className="w-60 bg-black text-white h-screen p-5 flex flex-col">
      <h1 className="text-2xl font-bold mb-8">Vortex Player</h1>
      <NavLink to="/" className="mb-4 hover:text-green-500">Home</NavLink>
      <NavLink to="/browse" className="mb-4 hover:text-green-500">Browse</NavLink>
      <NavLink to="/radio" className="mb-4 hover:text-green-500">Radio</NavLink>
      <NavLink to="/library" className="mb-4 hover:text-green-500">Library</NavLink>
      <div className="mt-auto">
        <h2 className="text-lg font-bold">Your Library</h2>
        <NavLink to="/recently-played" className="mb-2 hover:text-green-500">Recently Played</NavLink>
        <NavLink to="/liked-songs" className="mb-2 hover:text-green-500">Liked Songs</NavLink>
        <NavLink to="/albums" className="mb-2 hover:text-green-500">Albums</NavLink>
        <NavLink to="/artists" className="mb-2 hover:text-green-500">Artists</NavLink>
        <NavLink to="/podcasts" className="mb-2 hover:text-green-500">Podcasts</NavLink>
        <h2 className="text-lg font-bold mt-4">Playlists</h2>
        <NavLink to="/playlist1" className="mb-2 hover:text-green-500">Playlist 1</NavLink>
        <NavLink to="/playlist2" className="mb-2 hover:text-green-500">Playlist 2</NavLink>
        <NavLink to="/playlist3" className="mb-2 hover:text-green-500">Playlist 3</NavLink>
      </div>
    </div>
  );
};

export default Sidebar;
